  false,\n\t\"url\": null,\n\t\"notes\": \"Observational reports of daily air temperature
  (1200 UTC to 1200 UTC) are made by members of the NWS Automated Surface Observing
  Systems (ASOS) network; NWS Cooperative Observer Network (COOP); and the Hydrometeorological
  Automated Data System (HADS) network. Reports from approximately 4,500 stations
  across the US including Alaska, Hawaii, & Puerto Rico are sent on a daily basis
  to the Climate Prediction Center (CPC). CPC processes these reports once per day.
  All reports for the same day are put into an ASCII text file whose name includes
  the date of observation. These data are used by CPC in its role of supporting the
  Joint Agricultural Weather Facility (JAWF).\",\n\t\"license_title\": \"License Not
